import React from "react";

import BasicNav from '../componants/navbar'

function Landing() {
    return (
        <div>
            <BasicNav />
            <h3 style={{textAlign:'center', margin:'5%'}}>Welcome to Open Window Overflow where you can ask your dev questions and people can give solutions.</h3>
        </div>
    )
}

export default Landing;
